package operadoresLogicos;

public class Main {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		// Operadores Logicos
		// < Menor que
		// > Mayor que
		// == igualdad
		// != Diferente que
		// <= menor o igual
		// >= Mayor o igual

		// Devuelven dos tipos de valor
		// True = verdadero o False = FALSO
		/*
		 * 1 < 5 = true; 1 > 5 = false; 1 == 5 = false; 5 == 5 = true; 1 != 5 = true ;
		 * 5!= 5 = false; 1<= 5 = true; 5 <= 5 = true; 5 >= 5 = true;
		 */

		if (6 >= 7) {
			System.out.println(true);
		} else {
			System.out.println(false);
		}
	}
}
